import {
    AfterViewInit,
    Component, ElementRef,
    Input,
    OnInit, Pipe, PipeTransform, Renderer2, ViewChild,
} from '@angular/core';
import {PointResponse} from '../../services/map-api.service';
import {trigger, style, animate, transition} from '@angular/animations';
