@Pipe({name: 'safeHtml'})
export class SafeHtmlPipe implements PipeTransform {
    constructor(private sanitized: DomSanitizer) {
    }

    transform(value) {
        return this.sanitized.bypassSecurityTrustHtml(value);
    }
}


@Component({
    selector: 'app-place-card',
    templateUrl: './place-card.component.html',
    styleUrls: ['./place-card.component.scss'],
    animations: [
        trigger('slideInOut', [
            transition(':enter', [
                style({transform: 'translateY(150%)'}),
                animate('350ms ease-in', style({transform: 'translateY(0%)'}))
            ]),
            transition(':leave', [
                animate('350ms ease-in', style({transform: 'translateY(150%)'}))
            ])
        ])
    ]
})
export class PlaceCardComponent implements OnInit, AfterViewInit {

    @Input() point: PointResponse;
    @ViewChild('container', {read: ElementRef, static: true}) container: ElementRef;
    private observer: IntersectionObserver;
    description = 'Bardzo przyjemne miejsce na spacer z psem, dookoła lasy, małe jeziorko, mało ludzi. Bardzo przyjemne miejsce na spacer z psem, dookoła lasy, małe jeziorko, mało ludzi.Bardzo przyjemne miejsce na spacer z psem, dookoła lasy, małe jeziorko, mało ludzi.Bardzo przyjemne miejsce na spacer z psem, dookoła lasy, małe jeziorko, mało ludzi.Bardzo przyjemne miejsce na spacer z psem, dookoła lasy, małe jeziorko, mało ludzi.';
    trigger: Element;

    constructor(private renderer: Renderer2, public modalController: ModalController, private launchNavigator: LaunchNavigator) {

    }

    ngOnInit(): void {
        if (this.description.length > 319) {
        }
    }

    ngAfterViewInit(): void {
        console.log(this.checkOverflow());
        this.observer = new IntersectionObserver(entries => {
            entries.forEach((entry: any) => {
                if (entry.isIntersecting) {
                    this.renderer.addClass(this.container.nativeElement, 'increased-height');
                    console.log('trigger animation');
                } else {
                    this.renderer.removeClass(this.container.nativeElement, 'increased-height');

                }
            });
        });

        this.trigger = document.getElementById('trigger');
        if (this.trigger) {
            this.observer.observe(this.trigger);
        }
        // }
    }

    checkOverflow() {
        return this.container.nativeElement.scrollHeight == this.container.nativeElement.offsetHeight;
    }

    async showGallery() {
        const modal = await this.modalController.create({
            component: GalleryComponent,
            componentProps: {
                photos: [
                    'data:image/jpeg;base64,',
                    'data:image/jpeg;base64,',
                    'data:image/jpeg;base64,'
                ]
            }
        });

        return await modal.present();
    }

    navigate() {
        this.launchNavigator.navigate([this.point.latitude, this.point.longitude]);
    }
}

